    <tr>
      <th>{product._id}</th>
      <th>{product.name}</th>
      <th>
      <th>{product.category.name}</th>
      </th>
      <th>{product.price}</th>
      <th>{product.amount}</th>
      <th>{product.image}</th>
    </tr>
  );
};
